fn try_plain_read(&mut self) {
    // Read and process all available plaintext.
    let mut buf = Vec::new();

    let rc = self.tls_session.read_to_end(&mut buf);
    if rc.is_err() {
        error!("plaintext read failed: {:?}", rc);
        self.closing = true;
        return;
    }

    if !buf.is_empty() {
        debug!("plaintext read {:?}", buf.len());
        self.incoming_plaintext(&buf);
    }
}

